import React from "react"
import { Box, HStack } from "@chakra-ui/react";

const navlinks = [
    {
        name: "Home",
        link: "/home",
    },
    {
        name: "About",
        link: "/about",
    },
    {
        name:"Menu",
        link:"/menu",
    },
    {
        name:"Reservations",
        link:"/reservations",
    },
    {
        name:"order",
        link:"/order",
    },

    {
        name: "Login",
        link: "/login",
    },

];

const image =[
    {
        source: "./Assets/images/Logo.png",
        name:  "Log",
    }
];

const Nav = () =>{
return (
    <nav>
         <img src= "./Sectionfiles/Logo.png" alt = "Logo" width="500" height="600"/>
        <HStack>
        {navlinks.map((navlink, index) => (

            <a href={navlink.link}>{navlink.name}</a>
        ))}
        </HStack>
    </nav>
);

};
export default Nav;
